        legendItem.innerHTML = `<div class="legend-color-box" style="background-color: ${item.color}; opacity: ${traceVisible ? 1 : 0.5};"></div>${item.name}`;
        legendItem.style.color = traceVisible ? "black" : "gray";
        legendItem.onclick = function() {
            var currentVisibility = data[index].visible;
            // Toggle the visibility
            data[index].visible = (currentVisibility === true || currentVisibility === "true") ? false : true;
            if (data[index].visible) {
                legendItem.querySelector(".legend-color-box").style.opacity = "1";
                legendItem.style.color = "black";
            } else {
                legendItem.querySelector(".legend-color-box").style.opacity = "0.5";
                legendItem.style.color = "gray";
            }
            Plotly.react("plotly-figure", data, layout);
        };
        legendItem.ondblclick = function() {
            allVisible = !allVisible;
            data.forEach(function(trace) {
                trace.visible = allVisible;  // Set all traces to the same visibility state
            });
            Plotly.update("plotly-figure", data, layout);  // Update the plot
            var newOpacity = allVisible ? 1 : 0.5;
            var newColor = allVisible ? "black" : "gray";
            var legendItems = document.querySelectorAll(".legend-item");
            legendItems.forEach(function(item) {
                item.querySelector(".legend-color-box").style.opacity = newOpacity;
                item.style.color = newColor;
            });
        };
        legendDiv.appendChild(legendItem);
    });
</script>
</body>
</html>
